import React, { useState } from 'react';
import './Home.css';

function Booking() {
  const [bookings, setBookings] = useState([]);
  const [form, setForm] = useState({ name: '', email: '', date: '', time: '' });

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    setBookings([...bookings, form]);
    setForm({ name: '', email: '', date: '', time: '' });
  };

  return (
    <div className="home">
      <section className="contact-section" style={{maxWidth: 600, margin: '48px auto', background: '#fff', borderRadius: '2rem', boxShadow: '0 2px 16px rgba(108,71,255,0.07)', padding: '48px 32px'}}>
        <h2 className="solution-title" style={{marginBottom: 24}}>Book Now</h2>
        <div className="solution-desc" style={{marginBottom: 32}}>
          Schedule a call or appointment with SlickTalk.ai. Fill out your details and pick a date and time to experience AI voice automation for your business.
        </div>
        <form className="contact-form" style={{display: 'flex', flexDirection: 'column', gap: 18}} onSubmit={handleSubmit}>
          <input name="name" type="text" placeholder="Your Name" value={form.name} onChange={handleChange} style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} required />
          <input name="email" type="email" placeholder="Your Email" value={form.email} onChange={handleChange} style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} required />
          <input name="date" type="date" value={form.date} onChange={handleChange} style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} required />
          <input name="time" type="time" value={form.time} onChange={handleChange} style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} required />
          <button type="submit" className="pricing-btn" style={{marginTop: 12}}>Book Now</button>
        </form>
      </section>
      {bookings.length > 0 && (
        <section style={{maxWidth: 600, margin: '32px auto', background: '#faf6ff', borderRadius: '1.2rem', boxShadow: '0 2px 16px rgba(108,71,255,0.07)', padding: '32px 24px'}}>
          <h3 style={{marginBottom: 18, color: '#7c3aed'}}>Submitted Bookings</h3>
          <ul style={{paddingLeft: 0}}>
            {bookings.map((b, i) => (
              <li key={i} style={{marginBottom: 14, listStyle: 'none', background: '#fff', borderRadius: 8, padding: '12px 16px', boxShadow: '0 1px 6px rgba(108,71,255,0.06)'}}>
                <b>Name:</b> {b.name} <br />
                <b>Email:</b> {b.email} <br />
                <b>Date:</b> {b.date} <br />
                <b>Time:</b> {b.time}
              </li>
            ))}
          </ul>
        </section>
      )}
    </div>
  );
}

export default Booking;
